import style from './Landing.module.css'

const Landing = () => {
    return(
        <div className={style.container}>
            <div className={style.pContainer}>
                <p className={style.effectText}>Hello!... I'm Cesar, a Full Stack Web Developer....<span>&#160;</span></p>
            </div>
            <div className={style.imgContainer}><img src="./ReadyPlayerMe-Avatar.jpeg" alt="Cesar" /></div>
        </div>
    )
}

export default Landing;
